def find_camel_case_matches(N, Dictionary, Pattern):
    uppercase_letters = {}
    word_frequency = {}
    for word in Dictionary:
        uppercase_str = ''.join([char for char in word if char.isupper()])
        uppercase_letters[word] = uppercase_str
        if word in word_frequency:
            word_frequency[word] = 1
        else:
            word_frequency[word] += 1
    matching_words = []
    for (word, uppercase_str) in uppercase_letters.items():
        if len(uppercase_str) >= len(Pattern):
            if uppercase_str.startswith(Pattern):
                matching_words.extend([word] * word_frequency[word])
    return sorted(matching_words) if matching_words else -1

